import React, { useState } from "react";
import "./Search.css"; // Import styles

export default function Search() {
    // State management for search criteria
    const [searchCriteria, setSearchCriteria] = useState({
        make: "",
        model: "",
        year: "",
        state: "",
        carCondition: "",
        salesCategory: "",
        bodyType: "",
        fuelType: "",
    });

    // Handle input field changes
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setSearchCriteria({
            ...searchCriteria,
            [name]: value,
        });
    };

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Search Criteria:", searchCriteria);
        // Call API or execute search logic here
    };

    return (
        <div className="search-container">
            <h2>Car Search</h2>
            <form onSubmit={handleSubmit}>
                <div className="search-fields">
                    {/* Each row contains 4 input fields */}
                    <div className="search-row">
                        <div className="search-field">
                            <label>Make</label>
                            <input
                                type="text"
                                name="make"
                                value={searchCriteria.make}
                                onChange={handleInputChange}
                                placeholder="e.g., Audi"
                            />
                        </div>
                        <div className="search-field">
                            <label>Model</label>
                            <input
                                type="text"
                                name="model"
                                value={searchCriteria.model}
                                onChange={handleInputChange}
                                placeholder="e.g., A5"
                            />
                        </div>
                        <div className="search-field">
                            <label>Year</label>
                            <input
                                type="number"
                                name="year"
                                value={searchCriteria.year}
                                onChange={handleInputChange}
                                placeholder="e.g., 2015"
                            />
                        </div>
                        <div className="search-field">
                            <label>State/Region</label>
                            <input
                                type="text"
                                name="state"
                                value={searchCriteria.state}
                                onChange={handleInputChange}
                                placeholder="e.g., California"
                            />
                        </div>
                    </div>

                    <div className="search-row">
                        <div className="search-field">
                            <label>Condition</label>
                            <input
                                type="text"
                                name="carCondition"
                                value={searchCriteria.carCondition}
                                onChange={handleInputChange}
                                placeholder="e.g., Used"
                            />
                        </div>
                        <div className="search-field">
                            <label>Sales Category</label>
                            <input
                                type="text"
                                name="salesCategory"
                                value={searchCriteria.salesCategory}
                                onChange={handleInputChange}
                                placeholder="e.g., Private"
                            />
                        </div>
                        <div className="search-field">
                            <label>Body Type</label>
                            <input
                                type="text"
                                name="bodyType"
                                value={searchCriteria.bodyType}
                                onChange={handleInputChange}
                                placeholder="e.g., Sportback"
                            />
                        </div>
                        <div className="search-field">
                            <label>Fuel Type</label>
                            <input
                                type="text"
                                name="fuelType"
                                value={searchCriteria.fuelType}
                                onChange={handleInputChange}
                                placeholder="e.g., Diesel"
                            />
                        </div>
                    </div>
                </div>

                {/* Search button */}
                <button type="submit" className="search-button">
                    Search
                </button>
            </form>
        </div>
    );
}
